import React from 'react';
import './App.css';
import Particles from 'react-particles-js';
import logo from './Assets/logo_text.png'
import Image from 'react-image-resizer';

const particleParams = {
  particles: {
          number: {
              value: 100,
              density: {
                  enable: true,
                  value_area: 1500
              }
          },
          line_linked: {
              enable: true,
              opacity: 0.035
          },
          move: {
              direction: "right",
              speed: 0.05
          },
          size: {
              value: 1
          },
          opacity: {
              anim: {
                  enable: true,
                  speed: 1.5,
                  opacity_min: 0.05
              }
          }
      },
      interactivity: {
          events: {
              onhover: {
                  enable: true,
                  mode: "repulse"
              }
          },
          modes: {
              repulse: {
                  distance: 30
              }
          }
      },
      retina_detect: true
}

const h1Style = {
  fontFamily: "Gidole",
  fontSize: '70px',
  textAlign: 'center',
  color: '#fffee0',
}

const h2Style = {
  fontFamily: "Gidole",
  fontSize: '35px',
  color: '#fffee0',
  letterSpacing: 3
}

const divStyle = {
  align: 'center',
  display: 'flex',
  justifyContent: 'space-around',
  alignItems: 'center',
  position: 'sticky',
  top: 0,
  /*background: 'rgb(37, 45, 63) 100%',*/
  borderBottom: '1px solid #fffee0',
  height: 100,
  width: '90%'
}


const h2divStyle = {
  width: '100%',
  justifyContent: 'center',
  textAlign: 'center'
}


function App() {
  return (
    <>
      <div style = {divStyle}>
        <div style = {h2divStyle}>
          <h2 style = {h2Style}>SKILLS</h2>
        </div>
        <div style = {h2divStyle}>
          <h2 style = {h2Style}>CONTACT</h2>
        </div>
        <div style = {h2divStyle}>
          <h1 style = {h1Style}>ELTON</h1>
        </div>
        <div style = {h2divStyle}>
          <h2 style = {h2Style}>PROJECTS</h2>
        </div>
        <div style = {h2divStyle}>
          <h2 style = {h2Style}>ART</h2>
        </div>
      </div>
      <Particles params = {particleParams}/>
    </>

  );
}

export default App;
